import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from './App'

const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" exact element={App}/>
      </Routes>
    </BrowserRouter>
  );
};
